description:
The re-worked Class 66 for Train Simulator is available in Powerhaul livery and features an improved cab interior and new exterior, accurate brake control and centre-sprung brake lever, and accurate engine and horn sounds. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the Powerhaul Class 66 V2.0 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the GEML route (available separately and required to play these scenarios).



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


